for i,k in enumerate(df['TE aerobico']):
  if k == '--':
    df.drop(i,axis=0,inplace=True)
df['TE aerobico'] = pd.to_numeric(df['TE aerobico'])

df['Esfuerzo'].replace(['Calentamiento','Suave', 'Aerobico', 'Umbral','Maximo'  ],[0,1,2,3,4], inplace=True)
